/** @format */

// Carousel data for finished table photos on homepage
const finishedTablePhotos = [
    {
        image: "./images/Finish Top.jpg",
        title: "Table Top View",
        description: "Top view of the completed table showing intricate sand patterns",
    },
    {
        image: "./images/Finish Top Side Lights.jpg",
        title: "Expanded Full Table Top View with Lights",
        description: "Side angle showcasing the mesmerizing pattern creation with lights",
    },
    {
        image: "./images/Finish Top Lights.jpg",
        title: "Full Table Top View with Lights",
        description: "Complete overview of the handcrafted coffee table with art and lights",
    },
    {
        image: "./images/Finish Side Over Lights.jpg",
        title: "Close Up Top View with Lights",
        description: "Close up of the handcrafted coffee table with are and lights",
    },
    {
        image: "./images/My Table Top.jpg",
        title: "Full Table View",
        description: "Complete view of the handcrafted coffee table",
    },
    {
        image: "./images/My Table Top Side.jpg",
        title: "Side Angle View No Lights",
        description: "Side angle showcasing table",
    },
    {
        image: "./images/My Table Side.jpg",
        title: "Full Side Table View",
        description: "Side view of the completed table showcasing the under carriage shelf",
    },
];

export default finishedTablePhotos;
